import React from 'react';
import './Button.css';
function Buttonfinal(props) {
    return(
        <div>
            <button type="button" name="nombreboton" class= "Boton" placeholder={props.PlaceHolderButtonfinal}></button>
        </div>
    )
}
export default Buttonfinal;
